import React from 'react'

class ArticleCard extends React.Component{
    render(){
        console.log(this.props.article)
        const {title, author, description} = this.props.article
        return(
            <div>
                <h3>{title}</h3>
                <h2>{author}</h2>
                <p>{description}</p>
            </div>
        )
    }
}

export default ArticleCard
